import "../styles/logPage.css";

export default function LogPage() {
	return (
		<div className="fullLogPage">
			<div className="headerLogPage"></div>
			<div className="mainLogPage"></div>
            <div className="footerLogPage">
                <button className="buttonRestart">

                    Log in</button>
            </div>
		</div>
	);
}
